# per pyinstaller. Fonte: https://stackoverflow.com/questions/31836104/pyinstaller-and-onefile-how-to-include-an-image-in-the-exe-file
def resource_path(relative_path):
    """ Get absolute path to resource, works for dev and for PyInstaller """
    try:
        # PyInstaller creates a temp folder and stores path in _MEIPASS
        base_path = sys._MEIPASS
    except Exception:
        base_path = os.path.abspath(".")

    return os.path.join(base_path, relative_path)

# controlla se la struttura è completamente piena di valori
def is_struttura_completa():
    for sheet_name in data.keys():  # itero per ogni struttura dati
        for cell in data[sheet_name].keys(): # itero per ogni cella (ogni chiave) di ogni struttura
            if data[sheet_name][cell][0] == None:
                return False
    return True

# trova e richiede i dati di input da terminale, usata per test
def richiedi_dati_input():
    print('\nInsert every values one by one as requested.\n')
    for sheet_name in data.keys():  # itero per ogni struttura dati
        for cell in data[sheet_name].keys(): # itero per ogni cella (ogni chiave) di ogni struttura
            if len(data[sheet_name][cell]) == 3:  # controllo se è dato di input
                try:  # se lo è chiedo l'input
                    data[sheet_name][cell][0] = float(input(data[sheet_name][cell][2] + ' [' + data[sheet_name][cell][1] + '] = '))
                except ValueError:
                    print('\nLast input data is not valid.')
                    input('\nPress \'enter\' key to close the program.')
                    exit(-1)
    return

